.about {
  width: 100vw;
  height: 100vh;
  background: #122f7e;
}
.header {
  height: 8%;
  width: 100%;
  margin-bottom: 10px;
  background-image: url("../../assets/yingzhi/topback.png");
  background-repeat: no-repeat;
  background-size: 100%;
  display: flex;
}
.daoy {
  position: relative;
  left: 20px;
  top: 5px;
}
.header_text {
  width: 30%;
  text-align: center;
  color: #fff;
  line-height: 50px;
  font-size: 20px;
  letter-spacing: 10px;
  float: left;
  position: absolute;
  left: 50%;
  top: 0%;
  margin-left: -15%;
}
button {
  border-radius: 10px;
  background: #1f3a89;
  width: 100px;
  height: 25px;
  outline: none;
  border: 1px solid #fff;
  margin: 5px;
  color: #6fdafc;
}
.backa {
  width: 1360px;
  height: 510px;
  border: 1px solid #0d6ca6;
  margin-left: 17px;
  margin-top: 10px;
}
button:hover {
  background: #fff;
  color: black;
}
.xian {
  width: 1px;
  background-color: #0d6ca6;
  height: 510px;
  position: absolute;
  left: 900px;
}
.da1 {
  margin-top: 25px;
  margin-left: -235px;
  color: #fff;
  /* display: flex; */
}

.yuan {
  border-radius: 60%;
  width: 40px;
  height: 40px;
  background: #6874ae;
  margin-top: -5px;
  margin-left: 5px;
}
.chax {
  border-radius: 7px;
  background: #fff;
  width: 50px;
  height: 28px;
  outline: none;
  border: 1px solid #fff;
  margin: 5px;
  color: black;
  text-align: center;
  margin-top: 10px;
  margin-left: 600px;
  font-family: 宋体;
}

.tab {
  width: 99%;
  margin-left: 0.2%;
  text-align: center;
  border: 1px solid #15c8fb;
  margin-top: -10px;
}
.tab td {
  border: 1px solid #15c8fb;
  color: #fff;
  font-size: 15px;
  height: 35px;
}
.tab th {
  border: 1px solid #15c8fb;
  color: #6ed9fb;
  font-size: 18px;
  height: 50px;
}
/* 分页开始 */
.page-bar {
  position: absolute;
  bottom: 17px;
  left: 35%;
  user-select: none;
}
.page-bar li {
  float: left;
  list-style: none;
}
.page-bar li:first-child > a {
  margin-left: 0px;
}
.page-bar a {
  border: 0;
  text-decoration: none;
  position: relative;
  text-align: center;
  margin-left: -1px;
  cursor: pointer;
  display: inline-block;
  width: 1.6vw;
  height: 1.6vw;
  line-height: 1.6vw;
  border-radius: 100%;
  background: #2373a1;
  margin: 0.5vw;
  color: #ffffff;
  font-size: 0.7vw;
}
.page-bar a .banclick {
  cursor: not-allowed;
}
.page-bar a i {
  font-style: normal;
  color: #d44950;
  margin: 0px 4px;
  font-size: 0.7vw;
}
.active a {
  cursor: default;
  background: #70dcfb;
}
.page-bar .shuang a {
  color: #fff;
}
.blocka {
  position: absolute;
  top: 630px;
  left: 440px;
  color: white;
}
